import React from "react";
import { Button, Link } from "react-bootstrap";

import "./styles.css";

function App() {
  return (
    <div className="App">
      <h1>Hello CodeSandbox</h1>
      <h2>Start editing to see some magic happen!</h2>
      <Button
        className="home-position"
        style={{ background: "gray" }}
        as={Link}
        href="/"
      >
        See Room
      </Button>
    </div>
  );
}

export default App;
